import {useState, useEffect} from 'react';
import MedalObj from './MedalObj';
const MedalsScroll = (props) => {
    let [informationMap] = useState(props.children.map);
    let [ifEarned] = useState(props.children.ifEarned);

    function createObj(input){
        if(ifEarned){
            return(<MedalObj date = {input["date"]} description = {input["description"]} ifEarned = {ifEarned}></MedalObj>);
        }
        else{
            return(<MedalObj done = {input["done"]} total = {input["total"]} description = {input["description"]} ifEarned = {ifEarned}></MedalObj>);
        }
    }


    return (
        <div id = "MedalsScroll">
            {informationMap.map(createObj)}
        </div>
    );
}

export default MedalsScroll;
